import React from 'react';
import CharacterCarousel from '../components/CharacterCarousel';  // Import the Carousel component
import HomeNavbar from '../components/HomeNavbar';  // Assuming you already have a HomeNavbar component

const CharacterPage = () => {
  return (
    <div>
      {/* Home Navbar */}
      <HomeNavbar />
      
      {/* Character Carousel */}
      <div className="container mx-auto py-8">
        <CharacterCarousel />
      </div>
    </div>
  );
};

export default CharacterPage;
